Tíolacfaidh an Coimisiúin roimh an 1 Iúil 1998:
— ag cuardach mianraí, — sa taighde eolaíoch agus teicniúil, — chun imoibritheoirí a rialú, — ar mhaithe le sláinte agus sábháilteacht;
Féadfaidh an Chúirt a cheangal, freisin, ar na Ballstáit agus ar na hinstitiúidi noch páirtithe iad sa chás gach faisnéis a thabhuirt u mheasfaidh an Chúirt is gá le haghaidh na n-imeachtaí.
